import React from "react"
import postlist from './posts.json'
import { makeStyles } from '@material-ui/styles'

const PostList = () => {

    const useStyles = makeStyles({
        container: {
        },
        cardPost: {
          backgroundColor: "#ffffff",
          marginBottom: "5px",
          borderRadius: '2px'
        },
        headerText: {
          fontWeight: "bolder"
        },
        headerLink: {
          textDecoration: "none",
          color: "black"
        },
      })
    
    const classes = useStyles();

    return (
        <div className="postlist">
        {postlist.length &&
        postlist.map((post, i) => {
            return (
                <div classNeme={classes.cardPost}>
                    <h2>{post.title}</h2>
                    <p>{post.content}</p>
                </div>
            )
        })}
        </div>
    )
}

export {PostList}
